import React from "react";
import {Event, Group, Home, LibraryAdd, Schedule, Settings} from "@mui/icons-material";

export const SidebarData = [
    {
        title:"Home",
        icon:<Home/>,
        link:"/home"
    },
    {
        title:"Schedule",
        icon:<Schedule/>,
        link:"/schedule"
    },
    {
        title:"Organizations",
        icon:<Group/>,
        link:"/organizations"
    },
    {
        title:"Library",
        icon:<LibraryAdd/>,
        link:"/library"
    },
    {
        title:"Events",
        icon:<Event/>,
        link:"/events"
    },
    {
        title:"Settings",
        icon:<Settings/>,
        link:"/settings"
    }
]
